"     Patient information: Jaundice in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/jaundice-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H31814361\">",
"      <span class=\"h1\">",
"       What is jaundice?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Jaundice is a condition that causes the skin or the whites of your eyes to turn yellow. It happens when you have too much of a certain substance in your blood. This substance is called &ldquo;bilirubin.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31814376\">",
"      <span class=\"h1\">",
"       What causes jaundice?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Jaundice is usually caused by problems with your liver. The liver is a big organ in the upper right side of the belly (",
"      <a class=\"graphic graphic_figure graphicRef64960 \" href=\"mobipreview.htm?39/54/40804\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Problems with the gallbladder or pancreas can also cause jaundice. Rarely, problems with the blood can cause jaundice.",
"     </p>",
"     <p>",
"      Problems with the liver, gallbladder or pancreas can be caused by:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Small stones that form inside the gallbladder, called gallstones",
"       </li>",
"       <li>",
"        Infections",
"       </li>",
"       <li>",
"        Heavy alcohol use",
"       </li>",
"       <li>",
"        Damage from medicines, herbal supplements, or illegal drugs",
"       </li>",
"       <li>",
"        Cancer",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You can also get jaundice after surgery, if you have certain blood disorders or if you have a condition called Gilbert&rsquo;s syndrome.",
"     </p>",
"     <p>",
"      Gilbert&rsquo;s syndrome is a common, harmless condition that can run in families. People with this syndrome sometimes get jaundice when they are under stress, take certain medicines, or have an infection. Women with Gilbert&rsquo;s syndrome might get jaundice around their periods.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31814391\">",
"      <span class=\"h1\">",
"       Is there a test for jaundice?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor will give you a blood test to measure the level of bilirubin in your blood. Your doctor",
"      <strong>",
"      </strong>",
"      might also give you tests to see what&rsquo;s causing your jaundice.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31814408\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will decide which tests you should have based on your age, other symptoms, and individual situation.",
"     </p>",
"     <p>",
"      Tests doctors use to find the cause of jaundice usually include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        An ultrasound &ndash; This test uses sound waves to take pictures of the organs inside your belly.",
"       </li>",
"       <li>",
"        A CT scan &ndash; This is a special kind of x-ray.",
"       </li>",
"       <li>",
"        An ERCP &ndash; This test involves putting a flexible tube down your throat and taking x-rays.",
"       </li>",
"       <li>",
"        A biopsy &ndash; For this test, a doctor takes a small sample of tissue from your liver. Then another doctor will look at the sample under a microscope.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31814423\">",
"      <span class=\"h1\">",
"       How is jaundice treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments depend on what&rsquo;s causing the jaundice. Your doctor or nurse might recommend that you:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Get plenty of rest - Ask your doctor or nurse when it is OK to go back to work or school",
"       </li>",
"       <li>",
"        Avoid alcohol.",
"       </li>",
"       <li>",
"        Avoid certain medicines - Your doctor or nurse will talk with you about the medicines you take and will tell you which ones to avoid.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your jaundice was caused by gallstones, you might also need to take medicines or have surgery to remove your gallbladder.",
"     </p>",
"     <p>",
"      If you have Gilbert&rsquo;s syndrome, you will not need to do anything extra to treat your jaundice. Gilbert&rsquo;s syndrome does not cause long-term problems on its own.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31814438\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
