"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?18/13/18650?source=related_link\">",
"      Evaluation and diagnosis of mastocytosis (cutaneous and systemic)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?39/54/40809?source=related_link\">",
"      Laboratory tests to support the clinical diagnosis of anaphylaxis",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?9/35/9785?source=related_link\">",
"      Latex allergy: Epidemiology, clinical manifestations, and diagnosis",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?5/44/5833?source=related_link\">",
"      Long-term management of patients with anaphylaxis",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?18/41/19096?source=related_link\">",
"      Marine toxins",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?20/28/20937?source=related_link\">",
"      Mast cell activation disorders",
